INSERT INTO `artikel` (`id_artikel`, `penulis`, `tanggal`, `judul`, `id_kategori`, `isi`, `gambar`) VALUES
(1, 'ABDUL KHAFIF', 'Selasa, 11 Juni 2024 | 22:24', 'PRESTASI ATLIT PORPROV CABANG IBCA MMA MERAIH JUARA UMUM ', 1, 'Prestasi Atlet IBCA MMA Kota Pasuruan yang Berhasil Meraih Juara Umum di Porprov 2023\r\n\r\nPada ajang Pekan Olahraga Provinsi (Porprov) 2023 yang diadakan di Surabaya, atlet-atlet Mixed Martial Arts (MMA) dari IBCA MMA Kota Pasuruan berhasil mengukir prestasi gemilang dengan meraih gelar juara umum. Keberhasilan ini menjadi kebanggaan tersendiri bagi Kota Pasuruan dan menunjukkan betapa kuat dan solidnya tim IBCA MMA dalam ajang kompetisi tingkat provinsi tersebut.\r\n\r\nPersiapan Menuju Porprov 2023\r\n\r\nPersiapan menuju Porprov 2023 sudah dimulai jauh-jauh hari oleh IBCA MMA Kota Pasuruan. Dengan latihan intensif yang dipimpin oleh pelatih berpengalaman, para atlet menjalani program latihan yang terstruktur dan disiplin tinggi. Fokus utama pelatihan meliputi penguatan fisik, teknik bertarung, serta strategi menghadapi lawan di ring. Tidak hanya itu, para atlet juga mendapatkan dukungan penuh dari pemerintah kota dan masyarakat yang selalu memberikan semangat dan motivasi.\r\n\r\nPerjalanan di Porprov 2023\r\n\r\nPada ajang Porprov 2023, atlet-atlet IBCA MMA Kota Pasuruan menunjukkan performa luar biasa. Dengan semangat juang yang tinggi dan ketekunan dalam latihan, mereka berhasil mengalahkan lawan-lawannya dalam berbagai kelas pertandingan.', );
INSERT INTO `artikel` (`id_artikel`, `penulis`, `tanggal`, `judul`, `id_kategori`, `isi`, `gambar`) VALUES
(2, 'MUSAALKADZIM', 'Selasa, 11 Juni 2024 | 22:25', 'HARI SANTRI KOTA PASURUAN 2023', 2, 'Hari Santri Kota Pasuruan\r\nMerayakan Spiritualitas dan Nasionalisme\r\n\r\nHari Santri Nasional, yang diperingati setiap tanggal 22 Oktober, menjadi momentum penting bagi masyarakat Kota Pasuruan untuk mengenang dan mengapresiasi peran besar para santri dalam perjuangan kemerdekaan Indonesia. Hari bersejarah ini tidak hanya dirayakan di pesantren, tetapi juga oleh seluruh lapisan masyarakat sebagai bentuk penghormatan terhadap kontribusi santri dalam membangun bangsa.\r\n\r\nPerayaan Hari Santri di Kota Pasuruan\r\nKota Pasuruan, yang dikenal sebagai salah satu pusat pendidikan Islam di Jawa Timur, selalu menggelar perayaan Hari Santri dengan penuh semangat dan khidmat. Berikut adalah beberapa kegiatan yang biasanya diadakan:\r\n\r\nUpacara Peringatan:\r\nUpacara bendera diadakan di alun-alun kota atau di halaman pondok pesantren, diikuti oleh santri, ulama, tokoh masyarakat, serta pejabat pemerintah. Upacara ini menjadi simbol persatuan dan komitmen untuk terus melanjutkan perjuangan para pendahulu.\r\n\r\nKirab Santri:\r\nKirab santri merupakan pawai yang diikuti oleh ribuan santri dari berbagai pesantren di Pasuruan. Mereka berbaris dengan rapi mengenakan pakaian tradisional, membawa bendera merah putih, dan atribut pesantren. Kirab ini tidak hanya menunjukkan kekompakan santri tetapi juga mengedukasi masyarakat tentang pentingnya peran santri dalam sejarah bangsa.\r\n\r\nLomba dan Festival:\r\nBerbagai lomba seperti lomba baca kitab kuning, cerdas cermat agama, serta festival seni dan budaya Islam diadakan untuk mengembangkan bakat dan kreativitas para santri. Lomba-lomba ini juga menjadi ajang silaturahmi antar pesantren dan mempererat hubungan antar santri.\r\n\r\nPengajian Akbar dan Tausiyah:\r\nPengajian akbar dengan menghadirkan ulama-ulama besar menjadi puncak perayaan Hari Santri. Tausiyah yang disampaikan berisi pesan-pesan moral dan motivasi untuk terus menjaga semangat keislaman dan nasionalisme.', );
INSERT INTO `artikel` (`id_artikel`, `penulis`, `tanggal`, `judul`, `id_kategori`, `isi`, `gambar`) VALUES
(3, 'MUSAALKADZIM', 'Selasa, 11 Juni 2024 | 22:26', 'PETIK LAUT', 3, 'PETIK LAUT KOTA PASURUAN\r\n\r\nPetik laut adalah sebuah upacara adat atau ritual sebagai rasa syukur kepada Tuhan, dan untuk memohon berkah rezeki dan keselamatan yang dilakukan oleh para nelayan. Umumnya, kegiatan ini diadakan di seluruh pulau Jawa.\r\n\r\nRitual\r\nRitual diawali pembuatan sesaji oleh sesepuh nelayan. Kemudian perahu kecil (perahu sesaji) disiapkan dan dibuat seindah mungkin mirip kapal nelayan yang biasa digunakan melaut, kemudian sesaji tersebut dihanyutkan ke laut.\r\n\r\nDalam upacara petik laut, para nelayan menghias perahu seindah mungkin. Selain itu, berbagai perayaan-perayaan dilaksanakan seperti mengadakan pengajian, orkes dangdut, dan sebagainya sesuai keinginan para nelayan di masing-masing daerah.\r\n\r\nDi Madura, semua jenis bahan yang dihanyutkan mengandung nilai filosofis kehidupan sehari-hari.\r\n\r\nPelaksanaan\r\nDi Pasuruan, Jawa Timur, petik laut diadakan pada hari ketujuh setelah Hari Raya Idul Fitri. Tradisi ini menjadi momen penting bagi para nelayan dan masyarakat setempat untuk bersama-sama merayakan kemenangan setelah bulan Ramadhan serta memohon berkah dan keselamatan di tahun yang akan datang.\r\n\r\nSelama pelaksanaan petik laut di Pasuruan, ritual dimulai dengan pembuatan sesaji yang dilakukan oleh sesepuh nelayan. Sesaji ini terdiri dari berbagai bahan yang memiliki nilai filosofis dan makna tertentu. Setelah itu, sebuah perahu kecil yang dihias dengan indah dihanyutkan ke laut sebagai simbol penghormatan kepada laut yang telah memberikan rezeki bagi para nelayan.\r\n\r\nSelain prosesi utama, berbagai acara pendukung seperti pengajian, pertunjukan musik dangdut, dan berbagai kegiatan hiburan lainnya diadakan untuk memeriahkan suasana. Tradisi ini tidak hanya menjadi ajang rasa syukur, tetapi juga mempererat hubungan sosial dan kebersamaan di antara masyarakat nelayan di Pasuruan.', );
INSERT INTO `artikel` (`id_artikel`, `penulis`, `tanggal`, `judul`, `id_kategori`, `isi`, `gambar`) VALUES
(4, 'MUSAALKADZIM', 'Selasa, 11 Juni 2024 | 22:28', 'TRUK TERGULING TERGULING GARA GARA REM BLONG', 4, 'Pasuruan - Isuzu Elf bernopol AD 1024 KA terguling di jalur tengkorak Jurang Ampel, Prigen, Pasuruan. Akibatnya, sejumlah penumpang terluka.\r\nKecelakaan terjadi sekitar pukul 08.00 WIB, saat itu Elf yang dikemudikan Franiko mengangkut lebih dari 10 orang penumpang melaju dari arah Trawas, Mojokerto ke arah Prigen Pasuruan.\r\n\r\nSampai di lokasi pegunungan yang terkenal dengan turunan curam, rem mobil travel itu tiba-tiba tidak berfungsi. Franiko berusaha sekuat tenaga mengerem namun nahas, minibus tergelincir dan terguling ke jurang.\r\n\r\nAkibat kejadian ini, tiga penumpang mengalami luka ringan dan trauma. Mereka langsung dilarikan ke Puskesmas Prigen untuk mendapatkan perawatan medis.\r\n', );

